import React, {Component} from 'react';
import Banner from './Banner';
import About from './About';
import Ourwork from './Ourwork';
import Testimonials from './Testimonials';
import More from './More';
import Contact from './Contact';
import Services from './Services';
import Footer from './Footer';

class Home extends React.Component{
    render(){
        return(
            <div>

        {/* <!-- banner page --> */}
            <div>
                <Banner />
            </div>
        {/* <!-- banner page --> */}

        {/* <!-- header --> */}

    {/* <!-- about --> */}
            <div>
                <About />
            </div>
    {/* <!-- //about --> */}

    {/* <!-- stats --> */}
            <div>
                <More />
            </div>
    {/* <!-- //stats --> */}
    {/* <!-- services --> */}
            <div>
                <Services />
            </div>
    {/* <!-- //services --> */}
    {/* <!-- how it works --> */}
            <div>
                <Ourwork />
            </div>
    {/* <!-- //how it works --> */}
    {/* <!-- testimonials --> */}
            <div>
                <Testimonials />
            </div>
    {/* <!-- //testimonials --> */}
    {/* <!-- contact --> */}
    <div>
      <Contact />
    </div>
    {/* <!-- contact -->*/ }
    {/* <!-- footer --> */}
    <div>
      <Footer />
    </div>
     {/* <!-- footer --> */}

    {/* <!-- login  --> */}
    <div>
      <Login />
    </div>
    {/* <!-- //login --> */}
    {/* <!-- register --> */}
    <div>
      <Register />
    </div>
    {/* <!-- // register --> */}

            </div>

        );
    }
}

export default Home;
